import logo from './logo.svg';
import './App.css';

import React, { useEffect, useRef } from 'react';
import * as THREE from 'three';
import BIRDS from 'vanta/dist/vanta.birds.min';

function App() {
  const vantaRef = useRef(null);

  useEffect(() => {
    let vantaEffect;
    if (!vantaEffect) {
      vantaEffect = BIRDS({
        el: vantaRef.current,
        THREE: THREE,
        mouseControls: true,
        touchControls: true,
        gyroControls: false,
        minHeight: 200.00,
        minWidth: 200.00,
        scale: 1.00,
        scaleMobile: 1.00,
        backgroundColor: 0x141312,
        color1: 0xffab00,
        color2: 0xc31515,
        birdSize: 1.50,
        wingSpan: 37.00,
        separation: 35.00,
        alignment: 18.00
      });
    }
    return () => {
      if (vantaEffect) vantaEffect.destroy();
    };
  }, []);

  return (
    <div className="App" ref={vantaRef} style={{ minHeight: "100vh" }}>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
